import React from 'react'

import FormInput from '../component/FormInput'

import { workshopArr } from '../Data'

const GetTicket = () => {

  const handleSubmit = (e) => {
    e.preventDefault();
    const data = new FormData(e);
  }

  return (
    <div className='TicketPage'>
      <form>
        <FormInput type="input" placeholder="First Name" />
        <FormInput type="input" placeholder="Last Name" />
        <FormInput type="input" placeholder="Phone Number" />
        <FormInput type="input" placeholder="Email" />
        <FormInput type="input" placeholder="School" />
        <FormInput type="menu" options={workshopArr} />
      </form>
    </div>
  )
}

export default GetTicket
